import React from "react";
import {Box} from "@mui/material";
import theme from "../utils/theme";
import Logo from "../static/image/Logo.png";
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import CallIcon from '@mui/icons-material/Call';
import EmailIcon from '@mui/icons-material/Email';

const Footer = ()=>{
  return <Box maxWidth="lg" height="374px" bgcolor={theme.color.primary} p="1rem" m='0 auto'>
    <Box display="flex" sx={{ xs:{flexDirection:'row'}, md:{flexDirection:'column'} }} justifyContent='center' alignItems='center' width='100%' height='100%'>
      <Box flex={1} display='flex' flexDirection='row'>
        <Box flex={3} display='flex' alignItems='center' justifyContent='center'>
          <img style={{ backgroundColor: 'white', borderRadius: '100%', border: '1px solid darkgreen' }} src={Logo} alt="logo" width={80} height={80} />
        </Box>
        <Box flex={6} display='flex' flexDirection='column' alignContent='center' justifyContent='center' gap='1rem'>
          <Box color='white' display='flex' alignItems='center' justifyContent='start' gap='0.5rem'><LocationOnIcon sx={{color:'white'}}/>Location: 1 Kingfisher St, Lidcombe NSW 2141 </Box>
          <Box color='white' display='flex' alignItems='center' justifyContent='start' gap='0.5rem'><CallIcon sx={{color:"white"}}/>Contacter: 61-410466077</Box>
          <Box color='white' display='flex' alignItems='center' justifyContent='start' gap='0.5rem'><EmailIcon sx={{color:"white"}}/>Email: admin@irisbakeing.com</Box>
          <Box display='flex' flexDirection='row' gap='1rem'>
            <FacebookIcon sx={{color:"white"}}/>
            <InstagramIcon sx={{color:"white"}}/>
          </Box>
        </Box>
      </Box>
      <Box flex={1}>Right container</Box>
    </Box>
  </Box>

} 

export default Footer;
